oor Will Not Close.";i:1;s:126:"The safety sensors are mounted near the bottom of the garage door and are typically located about six inches above the ground.";i:2;s:114:"These sensors are part of the automatic garage door opener and send a signal across the length of the garage door.";i:3;s:24:"Garage door not closing.";i:4;s:95:"Easy fixSafety sensors are the number one component that will cause a garage door not to close.";i:5;s:33:"Do you hear 10 clicks or the lig.";i:6;s:185:"Garage door will not close with remote but closes with wall button If you are having this problem and you have determined it is not the safety issues there are only a few possibilities.";i:7;s:33:"Check the battery in your remote.";i:8;s:64:"Most remotes use a watch style battery CR2032 they cost about 5.";i:9;s:55:"When changing the battery doesnt work try a new remote.";i:10;s:151:"The most common reason that a garage door wont close is an issue with the safety sensors that tell the door to stop closing when somethings in the way.";i:11;s:113:"Wipe the lenses down with a soft cloth to clean them up and then make sure the sensors on both sides of the door.";i:12;s:128:"If something gets in the way of this signal such as a child or pet your garage doors safety mechanism kicks in and it wont shut.";i:13;s:90:"The sensors have small LED lights to let you know when the signal is on and uninterrupted.";i:14;s:83:"Thats very helpful in finding out if theyre the reason your garage door wont close.";i:15;s:174:"If one side of the door is not in line with the other the door wont run smoothly in its tracks and when closed one side of the door wont close completely leaving an open gap.";i:16;s:106:"Side-mounted extension springs are installed above the horizontal roller tracks on both sides of the door.";i:17;s:112:"The extension springs are evenly matched and installed to keep the garage door properly aligned so that it runs.";i:18;s:108:"One of the most common reasons that the garage door may not 